import React from 'react'
import Navigation from '../components/Navigation'
import ProjectCard from '../components/ProjectCard'
import content from '../content'

function Projects() {
  return (
    <div>
        <Navigation />
        <p className='underline text-3xl font-bold'>Termin 1</p>
        <p className='underline text-3xl font-bold'>Dette er prosjekter som eg har hatt i første termin på haugaland vgs</p>

        <div className='grid grid-cols-3'>
        {content.termin1.prosjekter.map((input) => {
            return (
                <ProjectCard title={input.title} content={input.content} />
            )
        })}
        </div>
    </div>
  )
}

export default Projects
